# Limpa o post de caracteres que não são aceitos ao criar um arquivo EXCEL
def clean_text(text):
    """Remove caracteres ilegais para Excel"""
    return re.sub(r'[\000-\010\013\014\016-\037]', '', text) if isinstance(text, str) else text


def get_posts(actor):
    url = "https://public.api.bsky.app/xrpc/app.bsky.feed.getAuthorFeed" # Site do API do Bluesky
    cursor = None # Necessário para coleta acima de 100 posts do API
    all_posts = [[], []] # Matriz que armazena o post (1ª coluna) e a data que foi postado (2ª coluna)
    tries = 0 # Necessário para evitar loops infinitos quando houver erros no scrapping

    while True:
        # parâmetros para o API do Bluesky
        params = {
            "actor": actor, # Usuário
            "limit": 100, # Quantidade de posts
            "filter": "posts_no_replies", # apenas posts sem replies
        }
        if cursor:
            params["cursor"] = cursor # Necessário para continuar usando o API, coletando mais do que 100 posts

        try:
            # chamando o API (retorna um json)
            resp = requests.get(url, params=params, timeout=10)
            resp.raise_for_status()
            data = resp.json()

        # Evitando loops infinitos
        except Exception as e:
            tries += 1
            print(f"Tentativa {tries} falhou para {actor}: {e}")
            if tries > 3:
                print(f"Desistindo de {actor}")
                break
            time.sleep(2)
            continue

        # Armazenando o post e a data na matriz 'all_posts'
        for item in data.get("feed", []):
            post = item.get("post", {})
            record = post.get("record", {})
            text = record.get("text", "") # texto do post no arquivo json
            time_post = record.get("createdAt", "") # data do post no arquivo json

            if text:
                all_posts[0].append(text)
                all_posts[1].append(time_post)
        
        cursor = data.get("cursor")

        # Termina quando não houver mais posts ou quando já tiver pego mais do 5000 posts
        if not cursor or len(all_posts[0]) > 5000:
            break

    return actor, all_posts

    
def main():
    start = time.time() # Para ver quanto tempo o código está rodando

    # Para evitar ficar dias no scrapping, Uso 'ThreadPoolExecutor(max_workers=50)' para
    # coletar os posts de 50 usuários ao mesmo tempo
    with ThreadPoolExecutor(max_workers=50) as executor:
        futures = [executor.submit(get_posts, x) for x in followers_list]
        for future in as_completed(futures):
            try:
                actor, posts = future.result()
                
                if len(posts[0]) == 0: # Evita usuários que nunca postaram
                    print(f"Pulando {actor} pois tem {len(posts[0])} posts")
                    continue

                # Salvando os posts com as datas em um arquivo EXCEL
                print(f"Salvando {actor}.xlsx com {len(posts[0])} posts")
                df = pd.DataFrame(posts).T
                df.columns = ["post", "date"]
                df["post"] = df["post"].apply(clean_text)
                df.to_excel(f"{actor}.xlsx", index=False)
                
            except Exception as e:
                print(f"Erro para {actor}: {e}") # Para ver quanto tempo o código está rodando

    print("Elapsed time:", time.time() - start, "seconds")

if __name__ == "__main__":

    main()


